import React from 'react';
import Card from './Card';
import Button from './Button';
import styles from './ErrorModal.module.css';
function ErrorModal(props) {
    const content ={
        title : "Title of Error" ,
        message : " Error Message goes here.....!!!!"
    }
  return (
    <div>
    <div className={styles.backdrop} onClick={props.onConfirm}></div>
    <Card className={styles.modal}>
    {/* <form onSubmit={submitHandler} className="form_part"> */}
    <form className={styles.form_part} >
        <div className={styles.welcome}>
          <h1 className={styles.welcome_text}> Welcome to Debuginit !</h1>
        </div>
        {/* {props.error !== "" ? (
          <div className={`error ${props.error !== '' ? 'shake': '' }` }onClick={clearError}>
            <p className="error_message">{props.error}</p>
          </div>
        ) : (
          ""
        )} */}
        <div className={styles.input_box}>
          <label htmlFor="name ">Name</label>
          <br />
          <input
            type="text"
            name="name"
            id="name"
            // onChange={nameHandler}
            // value={details.name}
            className={styles.text_input}
          />
        </div>
        <br />
        <div className={styles.input_box}>
          <label htmlFor="email">Email</label>
         <br />
          <input
            type="email"
            name="email"
            id="email"
            // onChange={emailHandler}
            // value={details.email}
            className={styles.text_input}
          />
        </div>
        <br />
        <div className={styles.input_box}>
          <label htmlFor="password">Password</label>
         <br />
          <input
            type="password"
            name="password"
            id="password"
            // onChange={passwordHandler}
            // value={details.password}
            className={styles.text_input}
          />
        </div>
        <Button onClick={props.onConfirm} className={styles.login_btn}>Login</Button>
      </form>
    </Card>
    </div>
  )
};

export default ErrorModal;
